export interface IUser {
    username: string
    first_name: string;
    last_name: string;
    email: string;
    color: string;
}

export interface IProfile<User = IUser> {
    user: User;
    avatar: string;
    time_zone: number;
    color: string;
}

export type UserUpdateDto = Partial<IProfile<Partial<IUser>>>;

export type UserPasswordDto = {
    current_password: string;
    change
};
